import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the profile link and click it
    await page.waitForSelector('a:has-text("Your Profile")');
    await page.click('a:has-text("Your Profile")');
    await page.waitForLoadState('networkidle');

    // Take screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const profileData = await page.evaluate(() => {
      const username = document.querySelector('.username')?.textContent || '';
      const fullName = document.querySelector('h2')?.textContent || '';
      const email = document.querySelector('.bio')?.textContent || '';
      const joinDate = document.querySelector('.stat-label:has-text("Join Date")')?.nextElementSibling?.textContent || '';
      return { username, fullName, email, joinDate };
    });

    return {
      success: true,
      action: "User profile information harvested successfully",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
